import React, { useState } from 'react';
import { Button, ButtonGroup, Typography, Paper, Container, CssBaseline, Box, Link, Avatar } from '@mui/material';
import { styled } from '@mui/styles';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import TableCell from '@mui/material/TableCell';
import TableRow from '@mui/material/TableRow';
import TableContainer from '@mui/material/TableContainer';
import Table from '@mui/material/Table';
import TableHead from '@mui/material/TableHead';
import TableBody from '@mui/material/TableBody';
import SupervisorAccountIcon from '@mui/icons-material/SupervisorAccount';
import ScienceIcon from '@mui/icons-material/Science';
import BuildIcon from '@mui/icons-material/Build';
import SaveIcon from '@mui/icons-material/Save';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  color: theme.palette.common.black,
  border: '1px solid #ddd',
  padding: '0.5rem',
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: '#ffffff',
  },
  '&:nth-of-type(even)': {
    backgroundColor: '#f5f5f5',
  },
}));

const StyledButton = styled(Button)(({ theme }) => ({
  margin: '0 5px',
}));

const users = [
  { id: 1, name: 'Juan Araque', email: 'jaraque129@puce.edu.ec', role: 'Administrador', avatar: 'https://example.com/avatar.png' },
  { id: 2, name: 'Usuario Puce', email: 'usuario@puce.edu.ec', role: 'Investigador', avatar: 'https://example.com/avatar.png' },
  { id: 3, name: 'Usuario Puce', email: 'usuario@puce.edu.ec', role: 'Técnico', avatar: 'https://example.com/avatar.png' },
  { id: 4, name: 'Usuario Puce', email: 'usuario@puce.edu.ec', role: 'Investigador', avatar: 'https://example.com/avatar.png' },
  { id: 5, name: 'Usuario Puce', email: 'usuario@puce.edu.ec', role: 'Técnico', avatar: 'https://example.com/avatar.png' },
];

function RoleAssignment() {
  const [buttonColors, setButtonColors] = useState(Array(users.length * 3).fill("primary"));

  const handleClick = (index) => {
    const newButtonColors = [...buttonColors];
    newButtonColors[index] = newButtonColors[index] === "primary" ? "secondary" : "primary";
    setButtonColors(newButtonColors);
  };

  return (
    <div>
      <AppBar position="static" color="transparent" elevation={0}>
        <Container maxWidth="lg">
          <Toolbar>
            <Typography variant="h6" component={Link} to="/" style={{ fontSize: '1.6rem', fontWeight: 'bold', textDecoration: 'none', color: '#333' }}>
              <span style={{ fontFamily: 'Helvetica, Arial, sans-serif' }}>Bio-Inka</span>
            </Typography>
            <Box style={{ display: 'flex', gap: '1.5rem' }}>
              <Link to="/inicio/geo" style={{ fontSize: '1.2rem', color: '#333', textDecoration: 'none', padding: '0.5rem', borderRadius: '0.25rem', transition: 'background-color 0.3s ease', fontFamily: 'Roboto, sans-serif' }}>Georreferenciación</Link>
              <Link to="/inicio/iniciova" style={{ fontSize: '1.2rem', color: '#333', textDecoration: 'none', padding: '0.5rem', borderRadius: '0.25rem', transition: 'background-color 0.3s ease', fontFamily: 'Roboto, sans-serif' }}>Destacados</Link>
              <Link to="/inicio/about" style={{ fontSize: '1.2rem', color: '#333', textDecoration: 'none', padding: '0.5rem', borderRadius: '0.25rem', transition: 'background-color 0.3s ease', fontFamily: 'Roboto, sans-serif' }}>Acerca de nosotros</Link>
              <Link to="/inicio/login" style={{ fontSize: '1.2rem', color: '#333', textDecoration: 'none', padding: '0.5rem', borderRadius: '0.25rem', transition: 'background-color 0.3s ease', fontFamily: 'Roboto, sans-serif' }}>Log-In</Link>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      <Container component="main" maxWidth="md" sx={{ py: 5, my: 8, boxShadow: 3 }}>
        <CssBaseline />
        <Typography variant="h5" align="center" gutterBottom>Asignación de Roles</Typography>
        <Typography variant="body1" gutterBottom>
          Se ha implementado la funcionalidad de asignación de roles en el sistema, brindando a los administradores la capacidad de asignar roles específicos a los usuarios, como visor, editor o administrador. Esta funcionalidad incluye lo siguiente:
        </Typography>
        <Typography variant="body1" gutterBottom>
          - Interfaz de asignación de roles: Se ha creado una interfaz intuitiva en la cual los administradores pueden seleccionar a un usuario y asignarle un rol específico. Se han proporcionado opciones claras y descriptivas para cada tipo de rol, lo que permite una asignación precisa y fácil de comprender.
        </Typography>
        <Typography variant="body1" gutterBottom>
          - Usuarios:
        </Typography>
        <TableContainer component={Paper} sx={{ backgroundColor: 'transparent', marginTop: '2rem' }}>
          <Table sx={{ minWidth: 700 }} aria-label="customized table">
            <TableHead>
              <TableRow>
                <StyledTableCell style={{ backgroundColor: '#f5f5f5', fontWeight: 'bold', fontFamily: 'Helvetica, Arial, sans-serif' }}>Usuario</StyledTableCell>
                <StyledTableCell style={{ backgroundColor: '#f5f5f5', fontWeight: 'bold', fontFamily: 'Helvetica, Arial, sans-serif' }}>Email</StyledTableCell>
                <StyledTableCell style={{ backgroundColor: '#f5f5f5', fontWeight: 'bold', fontFamily: 'Helvetica, Arial, sans-serif' }}>Rol</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {users.map((user) => (
                <StyledTableRow key={user.id}>
                  <StyledTableCell>
                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                      <Avatar src={user.avatar} alt={user.name} />
                      <Typography variant="body1" sx={{ marginLeft: '0.5rem' }}>{user.name}</Typography>
                    </Box>
                  </StyledTableCell>
                  <StyledTableCell>{user.email}</StyledTableCell>
                  <StyledTableCell>
                    <ButtonGroup variant="text" aria-label="outlined primary button group">
                      <StyledButton startIcon={<SupervisorAccountIcon />} variant={buttonColors[user.id*3 - 3] === "primary" ? "outlined" : "contained"} color="primary" onClick={() => handleClick(user.id*3 - 3)}>Administrador</StyledButton>
                      <StyledButton startIcon={<ScienceIcon />} variant={buttonColors[user.id*3 - 2] === "primary" ? "outlined" : "contained"} color="primary" onClick={() => handleClick(user.id*3 - 2)}>Investigador</StyledButton>
                      <StyledButton startIcon={<BuildIcon />} variant={buttonColors[user.id*3 - 1] === "primary" ? "outlined" : "contained"} color="primary" onClick={() => handleClick(user.id*3 - 1)}>Técnico</StyledButton>
                    </ButtonGroup>
                  </StyledTableCell>
                </StyledTableRow>
              ))}
            </TableBody>
          </Table>
          <Button variant="contained" color="primary" startIcon={<SaveIcon />} style={{ marginTop: '2px', marginBottom: '1px', float: 'right' }}>Guardar</Button>
        </TableContainer>
      </Container>
    </div>
  );
}

export default RoleAssignment;
